import React from "react";

function VaccineScreen() {
  return (
    <div>
      <div className="side-effects">
        <div>
          <h1>Common Side Effects(AEFI)</h1>
        </div>
        <div>
          <img src="images/heda.jpg" alt="sideefffects" />
        </div>
      </div>
    </div>
  );
}

export default VaccineScreen;
